import React from 'react';
import { View, StyleSheet, Text } from 'react-native';
import { useDimensions } from '@react-native-community/hooks';


function PlantsCirclePreview(props) {
    const PrevieWidth = useDimensions().screen.width;

    return (
        <View style={styles.previewContainer} width={PrevieWidth/5}>
            <View style={styles.circlePreview}></View>
            <Text>koko</Text>
        </View>
    );
}



const styles = StyleSheet.create({
    previewContainer: {
        flex: 1,
        justifyContent: 'start',
        alignItems: 'center',
    },
    circlePreview: {
        backgroundColor: 'pink',
        height: '50%',
        borderRadius: '50%',
        marginBottom: '6%',

    }
})

export default PlantsCirclePreview;
